  true,\n\t\"url\": null,\n\t\"notes\": \"The first major set of trials conducted
  at the Michigan Test Bed was the Proof of Concept (POC) trials during 2008. The
  POC trials featured fifty-two RSEs within 45 square miles, 27 vehicles configured
  with OBEs, and a Dedicated Short-Range Communications (DSRC) network. The testing
  program had three major phases: subsystem test, system integration and test, and
  public and private applications test. The public application testing portion of
  the POC trials were conducted during August 2008. RSE data for the public application
  tests were available for eight days in August 2008. The data in this data environment
  consists of RSE and OBE data for the middle six of these days. These six days were
  chosen for inclusion in the data environment because the first and last days had
  much higher number of duplicate records and questionable data values.\",\n\t\"license_title\":
